import React, { useState } from 'react';
import './App.css';




function App() {


  return (
    <div className="App">

      <h2 className='title'>유튜브 짐코딩 채널</h2>
      <p className='content'>실용 적인 코딩 컨텐츠를 만들어나가는 접근입니다</p>
      <p className='italic'>실용 적인 코딩 컨텐츠를 만들어나가는 접근입니다</p>
    </div>
  );
}

export default App;
